import React from 'react'

export default function Sneaker(props) {

    console.log(`../assets/images/logos/${props.source_site}.png`)

    return (
        <div className='sneaker'>
            <img 
                src={require('../assets/images/placeholder-image.jpg')}
                alt={props.model}
            />
            <h3>{props. model}</h3>
            <img 
                src={require(`../assets/images/logos/${props.source_site}.png`)}
                alt={props.source_site}
            />
        </div>
    )
}
